<p>The problem is that when I send a notification from Realm it ends up in &quot;sent&quot;, but absolutely nothing happens, no logs in the Realm console, nothing on the Firebase side and nothing on the client side.</p>
<p><a href="https://i.stack.imgur.com/ByvNW.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/ByvNW.png" alt="Push notifications (Realm)" /></a></p>
<p>The documentation on push notifications for Realm is really limited and I can't quite figure out what to do. The documentation is mainly directed for IOS and Android.</p>
<p>That's my code in index.js:</p>
<pre class="lang-js prettyprint-override"><code>import PushNotificationIOS from '@react-native-community/push-notification-ios';
import PushNotification from 'react-native-push-notification';

PushNotification.configure({
  onRegister: function (token) {
    console.log('TOKEN:', token);
  },
  onNotification: function (notification) {
    console.log('NOTIFICATION:', notification);
    notification.finish(PushNotificationIOS.FetchResult.NoData);
  },

  onAction: function (notification) {
    console.log('ACTION:', notification.action);
    console.log('NOTIFICATION:', notification);
  },

  onRegistrationError: function (err) {
    console.error(err.message, err);
  },
  permissions: {
    alert: true,
    badge: true,
    sound: true,
  },
  popInitialNotification: true,
  requestPermissions: true,
});

PushNotification.createChannel(
  {
    channelId: 'fcm_fallback_notification_channel',
    channelName: 'FCM CHANNEL',
    channelDescription: 'Description test',
  },
  created =&gt; console.log(`CreateChannel returned '${created}'`),
);

PushNotification.localNotification({
  channelId: 'fcm_fallback_notification_channel',
  vibrate: true,
  vibration: 300,
  playSound: true,
  soundName: 'default',
});
</code></pre>
<p>Does anyone know of a tutorial or something that could give me some additional information?</p>

